import styled from "styled-components";

export const AddProductButton = styled.button`

  background-color: #4CAF50; 
  border: none;
  border-radius: 3px;
  color: white;
  padding: 12px 8px;
  text-align: center;
  text-decoration: none;
  display: inline-block;
  font-size: 14px;
  margin: 10px;
`;
